import './Tile.css';

export default function Tile({ number, image }) {
    if (number % 2 === 0) {
        return (
        <div className="tile black-tile">
            <div style={{backgroundImage: `url(${image})`}} className='chess-piece'></div>
            <img src={image}/>
        </div>
        );
    } else {
        return <div className="tile white-tile"><img src={image}/></div>
    }
}
